package flv

import (
	"bytes"
	"encoding/hex"
	flv0 "github.com/yutopp/go-flv"
	tag2 "github.com/yutopp/go-flv/tag"
	"testing"
)

func TestDecodeFlv(t *testing.T) {
	hexed := ""
	bs, err := hex.DecodeString(hexed)
	if err != nil {
		t.Fatal(err)
	}
	decoder, err := flv0.NewDecoder(bytes.NewReader(bs))
	if err != nil {
		t.Fatal(err)
		return
	}
	tag := &tag2.FlvTag{}
	err = decoder.Decode(tag)
	if err != nil {
		t.Fatal(err)
		return
	}
	data := tag.Data
	t.Logf("%+v", data)
}
